import logo from './logo.svg';
import './App.css';
import { Router } from 'react-router-dom';

function Navbar(){
  return(
    <div>
      <p>This is navbar</p>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route
              path="/events"
              element={<Events />}
          />
          <Route
              path="/annual"
              element={<AnnualReport />}
          />
          <Route path="/team" element={<Teams />} />
          <Route path="/blogs" element={<Blogs />} />
          <Route
              path="/sign-up"
              element={<SignUp />}
          />
      </Routes>
</Router>
  );
}

export default App;
